export default function Navbar() {
    return (
        <nav className="NavBar"> 
        <a href= "/" className= "SiteTitle"> Tatos</a>
        <ul>
            <li>
                <a href= "/Game"> Game </a>
                <a href= "/Credits"> Credits </a>
            </li>
        </ul>
        </nav>
    );
}
